# permutle.py

# create game

import itertools

per = '              PERMUTLE              \n'
emp = '                                    \n'
top = '      o---o---o o---o----o---o      '
mid = '     --------------------------     '
key = '   -------------------------------  '

deco = [' ', '.', '*']
comm = ['Genius', 'Magnificent', 'Impressive', 'Splendid', 'Great', 'Phew']
inva = 'Invalid guess. Try again.'

Y = list(itertools.permutations([1,2,3,4,5,6,7]))
X = [list(y) for y in Y]

def answer(i):
  x = X[i]
  return [{x[0],x[1]}, {x[1],x[2]}, {x[3],x[4]}, {x[4],x[5]}, {x[5],x[6]}]

U = [answer(i) for i in range(5040)]

alank = [ ["  "] * 5 for _ in range(6)]
blank = [ [0] * 5 for _ in range (6)]
clank = []
dlank = [ [0] * 7 for _ in range(7)]

for i in range(7):
  cc = [];
  for j in range(7):
    if j <= i:
      cc = cc + ["  "]
    else:
      cc = cc + [str(i+1)+str(j+1)]
  clank = clank + [cc]

def string(v):
  return str(min(v))+str(max(v))

def format(v):
  x = ""
  for j in range(5):
    x = x + string(v[j])
    if j != 4:
      x = x + " "
  return x

def centre(w):
  q = (36 - len(w)) // 2
  r = (36 - len(w)) % 2
  print(' '*q + w + ' '*(q+r))
  
def printle(a, b, c, d):
  print(emp*5+per+emp+top)
  for i in range(6):
    row = "     |"
    for j in range(5):
      row = row + deco[b[i][j]] + a[i][j] + deco[b[i][j]] + "|"
    print(row)
    if i != 5:
      print(mid)
  print(top+'\n'+emp+key)
  for i in range(6):
    row = "  | "
    for j in range(1,7):
      row = row + deco[d[i][j]] + c[i][j] + deco[d[i][j]] + " "
    row = row + "|"
    print(row)
  print(key+emp)

def readle():
  verify = 1
  Z = [] 
  guess = input()
  if (len(guess) != 14) or ({guess[z] for z in itertools.filterfalse(lambda x: x%3!=2, range(14))} != {' '}) or ({guess[z] for z in itertools.filterfalse(lambda x: x%3==2, range(14))} != {'1', '2', '3', '4', '5', '6', '7'}):
    verify = 0
  else:
    for j in range(5):
      Z = Z + [{int(guess[3*j]),int(guess[3*j+1])}]
  return verify, Z

def hardle(i, a, b, Z, mode):
  success = 1
  if i > 0 and mode == 'Hard':
    for j in range(5):
      if b[i-1][j] == 2 and not (a[i-1][j] == string(Z[j])):
        success = 0
      elif b[i-1][j] == 1 and not (a[i-1][j] in { string(Z[l]) for l in range(5) }):
        success = 0
        break
  return success

def guessle(v, mode, a, b, c, d, i):
  status = 0
  verify, Z = readle()
  if (verify == 0) or (not (Z in U)) or (hardle(i, a, b, Z, mode) == 0):
    status = 9
  else:
    for j in range(5):
      a[i][j] = string(Z[j])
      if Z[j] == v[j]:
        b[i][j] = 2
        d[min(Z[j])-1][max(Z[j])-1] = 2
      elif Z[j] in [v[k] for k in [0,1,2,3,4]]:
        b[i][j] = 1
        d[min(Z[j])-1][max(Z[j])-1] = 1
      else:
        c[min(Z[j])-1][max(Z[j])-1] = "  "
    if Z == v:
      status = 1
  return a, b, c, d, status

def permutle(answ, mode):
  v = answer(answ)
  a = alank[:]
  b = blank[:]
  c = clank[:]
  d = dlank[:]
  printle(a, b, c, d)
  for i in range(6):
    a, b, c, d, status = guessle(v, mode, a, b, c, d, i)
    while status == 9:
      centre(inva)
      a, b, c, d, status = guessle(v, mode, a, b, c, d, i)
    printle(a, b, c, d)
    if status == 1:
      centre(comm[i])
      print(emp)
      score = i
      break
  if status != 1:
    print(format(v))
    print(emp)
    score = 999
  return score
  

